This module export in the  <mkapi-api-link nav="@nav/api/MainModule" semantic="module">MainModule</mkapi-api-link>  the types included in the module  <mkapi-api-link nav="@nav/api/WorkersPoolModule" semantic="module">WorkersPoolModule</mkapi-api-link> 
(types only, no implementation).

It serves as helper when working with typescript, e.g.:
 ```ts
import { installWorkersPoolModule, WorkersType } from '@youwol/webpm-client'

async function foo(){
     const WPModule = await installWorkersPoolModule()
     const pool : WorkersType.WorkersPool = new WPModule.WorkersPool({})
}
``` 

See  <mkapi-api-link nav="@nav/api/MainModule.installWorkersPoolModule" semantic="function">installWorkersPoolModule</mkapi-api-link> .

